import React from 'react';
import styled from '@emotion/styled';

const TodoItem = ({ title, description }) => {
  return (
    <TodoItemStyled>
      <p>{title}</p>
      <p>{description}</p>
    </TodoItemStyled>
  );
};

const TodoItemStyled = styled.li`
  font-size: 20px;
  line-height: 20px;
  margin-bottom: 10px;
`;

export default TodoItem;
